script: |
  super -f text -I q3347.spq | sort > q3347.out

inputs:
  - name: q3347.spq
    data: |
      SELECT - 55 AS col0 FROM tab0 (FORMAT parquet) WHERE 7 + col2 NOT BETWEEN col2 / - col0 + + col0 * + - col0 + + + 74 AND - col2 / - - col0;
  - name: tab0

outputs:
  - name: q3347.out
    data: |
      -55
      -55
      -55
